<?phpnamespace Nemundo\App\ModelDesigner\Com\Table;use Nemundo\Admin\Com\Table\AdminClickableTable;use Nemundo\Admin\Com\Table\AdminTable;use Nemundo\Admin\Com\Table\AdminTableHeader;use Nemundo\Admin\Com\Table\Row\AdminTableRow;use Nemundo\App\ModelDesigner\ModelDesignerConfig;use Nemundo\App\ModelDesigner\Parameter\ProjectParameter;use Nemundo\App\ModelDesigner\Site\ProjectSite;use Nemundo\Com\TableBuilder\TableHeader;use Nemundo\Package\Bootstrap\Table\BootstrapClickableTableRow;class ProjectTable extends AdminTable  // AdminClickableTable{    public function getContent()    {        $header = new AdminTableHeader($this);        $header->addText('Project');        $header->addText('Project Name');        $header->addText('Model Path');        $header->addText('Namespace');        $header->addEmpty();        foreach ((new ModelDesignerConfig())->getProjectCollection()->getProjectList() as $project) {            $row = new AdminTableRow($this);  // new BootstrapClickableTableRow($this);            //$row->addText($project->project);            $site = clone(ProjectSite::$site);            $site->title = $project->project;            $site->addParameter(new ProjectParameter($project->projectName));            $row->addSite($site);            $row->addText($project->projectName);            $row->addText($project->modelPath);            $row->addText($project->namespace);            //$row->addClickableSite($site);        }        return parent::getContent();    }}